import React, { useState } from 'react';
import './Banner.css';

const img1 =
  'data:image/jpeg;base64,';
const img2 =
  'data:image/jpeg;base64,';
const img3 =
  'data:image/jpeg;base64,';
const img4 =
  'data:image/jpeg;base64,';
const img5 =
  'data:image/jpeg;base64,';
const img6 =
  'data:image/jpeg;base64,';

export default function Banner() {
  const [count, setCount] = useState(0);

  const TOTAL_IMGS = 5;

  const nextBtn = () => {
    setCount((count) => (count < TOTAL_IMGS ? count + 1 : (count = 0)));
  };

  const prevBtn = () => {
    setCount((count) => (count > 0 ? count - 1 : TOTAL_IMGS));
  };

  return (
    <div className="banner-container">
      <div className="banner-box">
        <div
          className="banner-img"
          style={{ transform: `translate(${count * -100}vw)` }}
        >
          <div className="banner-inner first">
            <img src={img1} />
          </div>
          <div className="banner-inner">
            <img src={img2} />
          </div>
          <div className="banner-inner">
            <img src={img3} />
          </div>
          <div className="banner-inner">
            <img src={img4} />
          </div>
          <div className="banner-inner">
            <img src={img5} />
          </div>
          <div className="banner-inner">
            <img src={img6} />
          </div>
        </div>
      </div>
      <button className="prev" onClick={prevBtn}>
        〈
      </button>
      <button className="next" onClick={nextBtn}>
        〉
      </button>
      <div className="chapter">
        <h3>{count + 1} / 6 </h3>
      </div>
    </div>
  );
}
